	def __cargarTranscripciones(self):
		for audio in Audio.objects.all():
			t = Transcriptor()
			e = Evaluador()
			c1, c2 = t.parse(audio.file)
			ch1 = e.normalizar(c1) 
			ch2 = e.normalizar(c2)
			audio.canal_1 = ch1
			audio.canal_2 = ch2
			audio.save()
	
